import React from 'react';
import './App.css';
import ScalpEth from './Components/ScalpEth';
import { useState } from 'react'

function App() {

const [isToggleOnFour, setToggleFour] = useState(true)

const [chart, setChart] = useState(1)


const hanClickFour = () => {
setToggleFour( isToggleOnFour  ? false : true)
}



return (

<div className="App">
<div className="Navbar">

<a onClick={hanClickFour}>Scalping ETH</a>

<a onClick={Chart = () => chart + 1}>Add ~Chart</a>

</div >

{isToggleOnFour ? false : <ScalpEth/>}

{chart === 1 ? <ScalpEth/> : false}




</div>

);
}

export default App;
